onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.en-US.min.js"] = (()=>{return(e,a)=>{const o=new Map([["useDefaultPlayerMode",`Set the default player mode. Could be <span>Normal</span>, <span>Widescreen</span>, <span>Web fullscreen</span> or <span>Fullscreen</span>.`],["defaultPlayerMode",`Select the default player mode.`],["applyPlayerModeOnPlay",`Apply mode on video play instead of page load.`],["useDefaultPlayerLayout",`Set the default player layout.\n- Old: The legacy layout\n- New: The default new layout\nWarning: Some features won't work on old layout.`],["defaultPlayerLayout",`Video player layout`],["defaultBangumiLayout",`Bangumi player layout`],["useDefaultVideoQuality",`Auto select the specified video quality. If the highest quality of video in lower than your choice, the highest quality will be used.`],["defaultVideoQuality","Select the default video quality."],["autoLightOff",`Auto turn off the light when video starts playing, and turn on the light after complete.`],["useDefaultDanmakuSettings",`Set the default settings about danmakus.`],["enableDanmaku",`Disable this if you want to turn off danmakus by default.`],["rememberDanmakuSettings",`Remember the "Prevent blocking subtitles" and "Smart danmaku mask" settings. If you change these settings on player, every video will apply these settings by default.`],["expandDanmakuList",`Auto expand the danmaku list.`],["autoPlay",`Auto start playing video on page load.`],["autoContinue",`If playback history exists, auto continue from it.`],["skipChargeList",`Skip charge acknowledgements on the end of some videos.`],["framePlayback",`Append 2 buttons to the right of video time to seek video by frame. Support keyboard shortcut <kbd>Shift</kbd>+<kbd>←</kbd>/<kbd>→</kbd>. (Old layout can only use keyboard shortcut)`],["playerFocus",`Auto scroll to the player when you enter the page.`],["playerFocusOffset",`Set the scroll offset. (in px unit)`],["customStyleColor",`Set the theme color for custom navbar, dark mode and more. Click the color circle to choose from 16 predefined colors, or input any valid hex color in textbox. (<span>#rrggbb</span> or <span>#rgb</span>)`],["useDarkStyle",`Dark mode looks much better at night, and will widely apply theme color.`],["darkSchedule",`Schedule the dark mode time.`],["compactLayout",`Use compact layout for homepage, reduce margin and remove rounded corner of video cards, use vector icons in categories.`],["useCommentStyle",`- Remove "Follow" button on hot comments\n- Remove the level badge of user\n- Remove the platform info (like <span>From Android client</span>)\n- Move post time to upper right.\n- Use vector icons\nTip: You can still access the removed "Follow" and level badge by hovering on their avatars.`],["simplifyLiveroom",`- Hide master icon\n- Hide fan badge\n- Hide event title\n- Hide user level\n- Hide captain icon\n- Hide global notice\n- Hide welcome message (xxx master entered room)\n- Hide lottery draw notifications\n- Disable room skin\nTip: Every item can be toggled individually in Add-ons.`],["blurVideoControl",`Use background blur effect for video controls.`],["customControlBackground",`Use a filled black rectangle as background of video controls instead of the original shadow effect.`],["customControlBackgroundOpacity",`Set the opacity of rectangle`],["harunaScale",`Make live room showgirl DPI-aware.`],["removeLiveWatermark",`Remove the watermark of live stream`],["removeVideoTopMask",`Remove the top mask of videos`],["removeAds",`Remove all ads. including slideshow ads, mobile app ads and video ads.`],["watchLaterRedirect",`Redirects all watchlater videos to the normal video page in order to use new layout.`],["favoritesRedirect",`Redirects all videos in favorites from favorites playlist to the individual video page.`],["hideTopSearch",`Use <span>"Search"</span> in place of search recommendations.`],["fullTweetsTitle",`Always expand full title in the feeds peek in navbar.`],["fullPageTitle",`Always expand full title of video episodes and (when there are many episodes) expand the entire list. (Not work for bangumi)`],["biliplusRedirect",`Append "Jump to BiliPlus" button to Add-ons.`],["imageResolution",`Request hi-resolution images by your screen DPI. But also cause longer loading time.`],["oldTweets",`Replace feeds link by the old version, and you can switch between new and old versions in Add-ons.`],["touchNavBar",`Allow to tap on a navbar item to view its popup info, instead of open the top-level link.`],["comboLike",`Allow long press the like button to perform a combo like.`],["touchVideoPlayer",`Increase margin of video control buttons for better touch experience. And enable touch gestures:\n- Left/Right slide to seek\n- Up/Down slide to adjust volume\n- Cancel a gesture on upper left/right corner\n- Slide on different position to use different sensibility.`],["touchVideoPlayerAnimation",`Use experimental animations for touch gestures, but may cause frame drops.`],["touchVideoPlayerDoubleTapControl",`Enable double-tap control: single tap to view/hide control bar, double tap to pause/resume.`],["toast",`Show toasts on the lower left corner of page, including update notifications and error display.`],["toastInternalError",`Show internal error messages, which may be helpful when reporting a bug.`],["useCache",`Use cache to increase load speed of this userscript.`],["outerWatchlater",`Move watchlater button from menu to outside.`],["i18n",`[Experimental] Provides UI translation for some common words.`],["i18nLanguage",`Set the target language.`],["customNavbar",`Enable custom navbar to replace the legacy one. New navbars in live/photos/shop are not affected.`],["customNavbarFill",`Use theme color to fill the navbar.`],[`customNavbarTransparent`,`Use transparent background if banner exists.`],["customNavbarShadow",`Drop shadow for custom navbar.`],["customNavbarCompact",`Use compact layout for custom navbar, provides smaller margins and use ... for long titles.`],["customNavbarBlur",`If top banner exists, use background blur effect.`],["playerShadow",`Use theme color shadow for player.`],["narrowDanmaku",`Force preserve danmaku input in web fullscreen mode. May cause buttons on the right out of screen.`],["hideOldEntry",`Hide "Back to old" buttons in new layout.`],["hideBanner",`Hide top banner.`],["allowJumpContinue",`Allow jump to episodes different from current.`],["hideBangumiReviews",`Hide reviews on bangumi page.`],["videoScreenshot",`Append screenshot button to the right of video time. Support keyboard shortcut <kbd>Ctrl</kbd>+<kbd>Alt</kbd>+<kbd>C</kbd>. (Old layout can only use keyboard shortcut)`],["filenameFormat",`Customize the filename format used by <span>Download danmaku</span>, <span>Download video</span>, <span>Video screenshot</span>, <span>View cover</span>.\nThere are a few variables:\n- <span>title</span>: Video title / Live room title\n- <span>ep</span>: Episode title\n- <span>aid</span>: AV ID\n- <span>cid</span>: CID (The unique ID of video, as AV ID may contains multiple episodes)\n- <span>lid</span>: Live room ID\n- <span>y</span>/<span>M</span>/<span>d</span>: Year / Month / Day of month\n- <span>h</span>/<span>m</span>/<span>s</span>/<span>ms</span>: Hour / Minute / Second / Millisecond\n\nThe default format is <span>[title][ - ep]</span>, representing video title and episode title. If episode title not exists, only video title is used.\n\nPut your variables inside square brackets, other contents inside brackets (like "<span> - </span>" in "<span>[ - ep]</span>") will only appear when the variable exists. For instance, if the format is <span>[title] - [ep]</span>. Even there's no episode title, that "<span> - </span>" will still appear in filename (which is meaningless). So in default format, when episode title not exists, "<span> - </span>" will also disappear.\n\nA more specific example: To use a "video title + AV ID + time" format, we can use <span>[title][ AVaid] [y]-[M]-[d] [h]-[m]-[s]</span>. And get filenames like "<span>xxxx AV23333 2019-05-29 19-59-44</span>".`],["noLiveAutoplay",`Disable autoplay on live homepage.`],["hideHomeLive",`Hide recommended live rooms on live homepage.`],["sideBarOffset",`Set vertical offset of side bar (in percent). Valid range: -40% ~ 40%.`],["hideCategory",`Hide category bar on main site, you can select category from Home in navbar.`],["foldComment",`Append a <span>"Fold comments"</span> button on the bottom of page when viewing comments in feeds. Then you can quickly fold comments without scrolling up.`],["showDeadVideoTitle",`Retrieve title and cover of dead videos in your space`],["useBiliplusRedirect",`Jump to BiliPlus for dead videos.`],["deadVideoTitleProvider",`Select dead video info provider: Watchlater is stable but takes some time, BiliPlus runs fast but it's not implemented yet.`],["useDefaultVideoSpeed",`Set the default video playback rate.`],["defaultVideoSpeed",`Select the default playback rate.`],["seedsToCoins",`Append a <span>Seeds to coins</span> button, click to convert 700 silver seeds to 1 coin, up to one time per day.`],["autoDraw",`Auto click draw button when there're drawing events in live room.`],["keymap",`Enable more keyboard shortcuts for video player:\n- <kbd>w</kbd> Web fullscreen\n- <kbd>t</kbd> Wide screen / Theater mode\n- <kbd>m</kbd> Toggle mute\n- <kbd>d</kbd> Toggle danmakus\n- <kbd>l</kbd> Like\n- <kbd>c</kbd> Coin\n- <kbd>s</kbd> Favorite\n- <kbd>j</kbd> 85s forward\n- <kbd>Shift + j</kbd> 85s backward\n- <kbd>Shift + ↑/↓</kbd> / <kbd>Shift + ,/.</kbd> Playback speed adjust\n- <kbd>Shift + /</kbd> Reset playback speed`],["doubleClickFullscreen",`Allow double click the player to toggle fullscreen, please note that this feature will not work if <span>播放器触摸支持</span> - <span>启用双击控制</span> is also enabled.`],["ajaxHook",`The Ajax Hook API may help other extensions or add-ons access ajax requests in bilibili.`],["scriptLoadingMode",`Feature loading mode:\n- Simultaneous: Load features as soon as possible\n- Delay: Load features after the original page has loaded\n- Simultaneous (Auto): Auto determine loading mode and prefer Simultaneous mode\n- Delay (Auto): Auto determine loading mode and prefer Delay mode`],[`fullActivityContent`,`Always expand for full content of feeds.`],[`activityImageSaver`,`When viewing a save-restricted image in feeds, you can right-click to get a toast with that image for saving.`],[`selectableColumnText`,`Make texts in column selectable.`],[`watchlaterExpireWarnings`,`Videos in watchlater will expire and be deleted in 60 days. Enable this feature will show a warning if a video will expire in less than 14 days.`],[`miniPlayerTouchMove`,`Allow touch drag to move mini player.`],[`feedsFilter`,`Filter out unwanted feeds by type or keywords, and remove side cards in your feeds homepage.`],[`hideBangumiSponsors`,`Hide bangumi sponsors sections and buttons.`],[`hideRecommendLive`,`Hide recommended live broadcasts in video pages.`],[`hideRelatedVideos`,`Hide related videos in video and bangumi pages.`],[`simplifyHome`,`Replace the original homepage by one of these style:\n- Simple: A clean design with additional feeds section.\n- Minimal: Only video feeds and trending videos, no other sections.`],[`autoMatchMedal`,`Auto wear medal when you have the medal of the current live room, or wear the last manually selected medal.`],[`urlParamsClean`,`Auto remove redundant params in URL.`],[`collapseLiveSideBar`,`Collapse the side bar of live room.`],[`batchFilenameFormat`,`Customize the filename format of batch downloads, following the same rule as <span>Filename format</span>.\nAdditional variables:\n- <span>n</span>: The counting number of n-th video in batch downloads`],[`removeGameMatchModule`,`Also remove e-sports module.`],[`customNavbarTransparent`,`Use transparent fill when banner exists.`],[`recordLiveDanmaku`,`Record and XML file in live danmaku recorder from add-ons.`],[`feedsTranslate`,`Append translate button to every feeds. Can translate feeds into Chinese or language specified in UI Translation.`],[`feedsTranslateProvider`,`The machine translate provider.`],[`updateCdn`,`Select mirror for hot updates, invalid in offline versions.`],[`preserveEventBanner`,`Preserve event banners in video page.`],[`useDefaultLiveQuality`,`Set the default live quality. Will switch to it automatically when watching live stream.`],[`defaultLiveQuality`,`Select the default live quality.`],[`fixedSidebars`,`Fix position of sidebars and navbar in feeds home.`],[`extendFeedsLive`,`Inside <span>Live broadcasting</span> panel, insert titles for every room. Also can display more than 10 rooms.`],[`playerOnTop`,`Show video player on top. Move title and author down.`],[`preferAvUrl`,`Convert BV ID to AV ID for URL of video.`],[`elegantScrollbar`,`Use narrow scrollbar in place of system default. (No effect to dark mode)`],[`quickFavorite`,`Enable quick favorite. Add a video to the selected favorite folder by one click in video page.`],[`darkColorScheme`,`Set dark mode to follow your system theme.`],[`disableFeedsDetails`,`Don't open feed details page after click, useful for selecting texts.`],[`danmakuSendBar`,`Show danmaku bar on bottom when fullscreen or web fullscreen.`],[`watchLaterRedirectNavbar`,`Redirect links on navbar.`],[`watchLaterRedirectPage`,`Redirect links on watchlater page.`],[`showCoverBeforePlay`,`Show cover image in video player before playing.`],[`customNavbarGlobalFixed`,`Fix navbar position on all pages.`]]);return{export:{toolTips:o}}}})();
onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.ja-JP.min.js"] = (()=>{return(a,e)=>{const n=new Map([["useDefaultPlayerLayout",`デフォルト・プレーヤー・レイアウトを設定する. できるだけ、適切なページに設定（例えば、番組の放送ページに番組プレーヤーのレイアウトを設定する）、そうでない場合は効果がない可能性があります.\n- 旧版: 伝統的なレイアウト\n- 新版: 動画ページに黙認の新版レイアウト\n注意: 伝統的なレイアウトでは、多くのスクリプト機能が適用されない.`],["defaultPlayerLayout",`動画プレーヤーのレイアウトを設定する.`],["defaultBangumiLayout",`番組プレーヤーのレイアウトを設定する.`],["useDefaultPlayerMode",`デフォルト・プレーヤー・モードが使用するかどうかを制御する、 例えば<span>常规</span>、<span>宽屏</span>、 <span>网页全屏</span>か<span>全屏</span>.`],["defaultPlayerMode",`デフォルト・プレーヤー・モードが設定する.`],["applyPlayerModeOnPlay",`再生時にモードを適用する、「いいえ」を選択すると、再生が開始されていないときに適用されます.`],["autoLightOff",`初回放送時には、自動的に消灯モードに入り、再生終了後に自動的に点灯します.`],["useDefaultVideoQuality",`動画を開くときに指定された画質を自動的に選択する. 映像の最高画質が選択された画質より低ければ、映像の最高画質を使用する.`],["defaultVideoQuality",`自動的に選択された映像画質を設定する.`],["useDefaultDanmakuSettings",`デフォルトで弾幕を開くかどうかを設定する.そして、「防挡字幕」と「智能防挡弹幕」を覚えておくかどうかを設定できる.`],["enableDanmaku",`弾幕がデフォルトで開くかどうかを制御する.`],["rememberDanmakuSettings",`弾幕ブロックの設定を覚えるかどうかを制御する、「防挡字幕」と「智能防挡弹幕」を含まれています.これらの設定を動画制御欄で変更すると、すべでの動画にデフォルトでこれらの設定が使用されます.`],["expandDanmakuList",`新版レイアウトでは、他のおすすめ動画が表示されるようにデフォルトで弾幕リストが折りたたまれています.この機能を有効にすると、動画が読み込まれるたびに弾幕リストが自動的に展開されます.`],["expandDescription",`長すぎる動画概要欄はデフォルトで折りたたまれています、この機能を有効にすると完全な動画概要欄が強制的に展開されます.`],["autoContinue",`動画再生時に視聴履歴が検出されると(<span>前回の见た...</span>情報)、自動的に対応する時間に再生される.`],["allowJumpContinue",`履歴のセット数が現在開いているページと矛盾している場合でも、自動的にジャンプします.`],["autoPlay",`動画ページに入ると、自動的に動画の再生が開始されます.`],["skipChargeList",`エンディングの「充电鸣谢」を自動スキップ.`],["framePlayback",`プレーヤーの時間に右側に2つのボタンが追加されました.動画の時間を細かく調整するために使用される. キーボードショートカットに対応します<kbd>Shift</kbd>+<kbd>←</kbd>/<kbd>→</kbd>. (伝統的なレイアウトでキーボードショートカットのみ使用でき、ボタンは表示されません)`],["videoScreenshot",`プレーヤーの時間に右側に1つのボタンが追加されました.動画スクリーンショットを使用されます. キーボードショートカットに対応します<kbd>Ctrl</kbd>+<kbd>Alt</kbd>+<kbd>C</kbd>. (伝統的なレイアウトでキーボードショートカットのみ使用でき、ボタンは表示されません)`],["playerFocus",`動画/番組の放送ページに入る時、プレーヤーに自動的に移動する.`],["playerFocusOffset",`移動時の垂直オフセット、単位はピクセル(px).`],["outerWatchlater",`動画放送ページの<span>稍后再看</span>を外に移動します.`],["keymap",`動画プレーヤーのためにより多くのショートカットを有効にします:\n- <kbd>w</kbd> ウェブの全画面\n- <kbd>t</kbd> ワイドモード\n- <kbd>m</kbd> 消音\n- <kbd>d</kbd> 弾幕スイッチ\n- <kbd>l</kbd> いいね\n- <kbd>c</kbd> コインを投げる\n- <kbd>s</kbd> お気に入り\n- <kbd>Shift + w</kbd> 後で見る\n- <kbd>Shift + ↑/↓</kbd> / <kbd>Shift + ,/.</kbd> 再生速度を調整する\n- <kbd>Shift + /</kbd> 再生速度をリセットする`],["doubleClickFullscreen",`ダブルクリックして全画面に切り替えることができます.ご注意ください<span>播放器触摸支持</span> - <span>启用双击控制</span>と共に使用できない.`],["customStyleColor",`頂欄(スタイルの調整が有効な場合）と夜間モードのテーマ色で埋める、カラープレビューサークルをクリックして、设定の16種類のテーマカラーにできるの、右側のテキストボックスに任意の有効な16進数のカラー値を直接入力することもできます.(<span>#rrggbb</span>或<span>#rgb</span>).`],["blurBackgroundOpacity",`设置顶栏对横幅的透明度(0~1), 数值越高顶栏越淡, 当横幅关闭时此选项无效.`],["customNavbar",`カスタム頂欄を使用する.伝統的な頂欄に取って代わる.メインステーション専用です.「生放送」、「アルバム」、「会員購」などには影響しません.`],["customNavbarSeasonLogo",`通常のロゴの代わりに季節のロゴを使用するかどうか.`],["customNavbarFill",`テーマ色で頂欄を埋める.`],[`customNavbarTransparent`,`トップの横断幕が存在する場合は、背景の透明効果を使用します.`],["customNavbarShadow",`頂欄に投影効果を追加する.`],["customNavbarCompact",`トップページにコンパクトなレイアウトを使する.コンパクトなレイアウトはより小さなスペースを使用し、そして動画のタイトルが長すぎる場合に後者の部分を省略するための 「...」を使用する.`],["customNavbarBlur",`トップの横断幕が存在する場合は、背景のぼかし効果を使用します.`],["useDarkStyle",`夜間モードでは、ページの明るい部分が暗い色に変わり、夜間の視聴に最適な表示になります.そして多くのテーマカラーを適用します.ぜひお試しください.`],["darkSchedule",`夜間モードを使用して计画タイムを設定する.この期間を開始または終了すると、夜間モードは自動的にオンまたはオフになり、終了時刻は開始時刻より短く、翌日と見なされます.例えば<span>18:00</span>から<span>6:00</span>夜の18：00から翌日の6：00までを表しています.`],["darkScheduleStart",`計画期間の開始時刻を設定する.`],["darkScheduleEnd",`計画期間の終了時刻を設定する.`],["compactLayout",`ホームページでコンパクトレイアウトを使用するかどうかを設定します.動画の間隔が狭くなり、フィレットが切り取られ、カテゴリ欄のアイコンは高解像度版を使用します.`],["useCommentStyle",`- 人気コメントのアバターの下にある「フォロー」ボタンを削除します\n- ユーザーの「レベル」アイコンの削除します\n- 発送端末の情報を削除(例えば<span>来自安卓客户端</span>)\n- 送信時刻は右上に移動します\n- ビットアイコンはすべてベクトルアイコンを入れ替えており、高解像度の画面はぼやけません．\n注釈:「フォロー」と「レベル」アイコンはマウスでアバタ上に置くことで，ポップアップした資料カードに表示することができる.`],["simplifyLiveroom",`- 「老爷」アイコンを隠す\n- 「ファン勲章」アイコンを隠す\n- 「活動肩書き」アイコンを隠す\n- 「レベル」アイコンを隠す\n- 「艦長」アイコンを隠す\n- 「全域放送」を隠す\n- 「ウェルカムメッセージ」を隠す (例えば、「xxx老爷进入直播间」)\n- 「ギフト弾幕」を隠す (弾幕リストのみ. 例えば「节奏风暴」など特殊効果は影響を受けません)\n- 「艦長購入のヒント」を隠す (弾幕リストの「xxxは艦長を購入する」)\n- 「有料ギフト」を隠す (プレーヤーの下でのさまざまな有料ギフト欄)\n- 「入場特殊効果」を隠す\n- 「看板娘」を隠す\n- 「イベント横断幕」を隠す\n- 「抽選のヒント」を隠す (例えば、「艦長」を購入する時、「小飞船」を購入する時、ギフトを抽選のヒント)\n- 配信ルームの「特殊な背景」を無効にする（ダークテーマでは、デフォルトでは「特殊な背景」も無効になっています）\n各項目は、非表示にするかどうかを<span>附加功能</span>の中で個別に選択することができる.`],["hideBanner",`トップページの横断幕を非表示.`],["playerShadow",`プレーヤーにテーマカラーの投影の追加する.`],["narrowDanmaku",`ウェブの全画面表示されている場合は、幅が狭すぎても弾幕欄を強制的に保持し.この場合には右側の機能ボタンが境界線を押し出してしまう可能性があることに注意する.`],["blurVideoControl",`動画制御欄の背景をぼかします.伝統的な陰影効果は無効になります.`],["customControlBackground",`動画制御欄に半透明な黒を付ける、伝統的な陰影効果を置き換える.`],["customControlBackgroundOpacity",`制御欄に黒の不透明度（0～1）を設定し、数値が大きくなるほど黒が濃くなるように設定します.`],["harunaScale",`スクリーンDPIによって、配信ルームの看板娘のサイズをスケーリングして、ピクセルの解像度を高めます.`],["removeLiveWatermark",`生放送時、隅の透かしを削除する.`],["removeVideoTopMask",`マウスが通過したら、動画の右上隅にあるタイトル層を削除します.`],["hideOldEntry",`放送ページの右側<span>返回旧版</span>を隠す.`],["hideBangumiReviews",`番組ページの採点区を隠す.`],["hideCategory",`ホームページのエリア欄を隠す、それでもエリア欄は頂欄のホームメニューからアクセスできます.`],["removeAds",`ビリビリのさまざまな広告を削除する.ホームページのプロモーションモジュール、モバイルアプリのおすすめ、動画ページの右側にある広告などが含まれます.`],["watchLaterRedirect",`「後で見る」のリンクを通常の再生ページに変更して、新版レイアウトの再生ページを使用する.`],["favoritesRedirect",`個人センターの「お気に入り」の動画を通常の再生ページに変更して、「お気に入り」再生の放送ページではなく.`],["hideTopSearch",`検索欄の推薦語を<span>搜索</span>に置き換える.`],["fullTweetsTitle",`頂欄のフィードプレビューページでは、常に完全なタイトルが展開されます.`],["fullPageTitle",`動画選集リストですべでを展開し、タイトルが1行を超えたら、別の行を開始して完全なタイトルを表示します.`],["showDeadVideoTitle",`個人センターの中に、失効した動画のタイトルとサムネイルを復元する.`],["useBiliplusRedirect",`失効した動画のリンクを「BiliPlus」ページに変更して.`],["deadVideoTitleProvider",`失効した動画の情報源: 「後で見る」は安定していますが、少し時間がかかります; 「BiliPlus」のスピードは速いですが、書き残していますので、しばらく開けません.`],["biliplusRedirect",`動画、番組、個人センターページで、追加機能<span>转到BiliPlus</span>をクリックして、BiliPlusの対応するページに移動します.`],["imageResolution",`スクリーンDPIによって、より高い解像度の画像を読み込む.（例えば、スクリーンのDPIが200％に調整されている場合、解像度は2倍になり、読み込み時間は長くなります.)`],["oldTweets",`「新版のフィード」リンクを 「旧版のフィード」に置き換え、追加機能で 「新版のフィード」/「旧版のフィード」を切り替えます.`],["i18n",`インタフェースの一般的なテキストの翻訳を提供する.`],["i18nLanguage",`翻訳言語`],["noLiveAutoplay",`生放送のホームページのおすすめライブルームで自動的に再生を開始することは禁止されています.`],["hideHomeLive",`生放送のホームページのおすすめライブルームを隠す.`],["foldComment",`フィードページにコメントを表示しているときに下部に「コメントを閉じる」ボタンを追加します.`],["seedsToCoins",`追加機能に<span>瓜子换硬币</span>ボタンを追加し、クリックして1日に1回に制限されて、1コインに700銀ヒマワリの種を交換してください.`],["touchNavBar",`頂欄の右側の1級リンクを削除します(<span>大会員</span>から<span>履歴</span>まで).タッチスクリーンデバイスですばやく情報を便利にします.削除されたリンクページはそれぞれのプレビューの中から<span>查看更多</span>に入ることができます.`],["comboLike",`「おすすめ三連」（「いいね」を長押した）のタッチサポートを有効にする.`],["touchVideoPlayer",`制御欄のボタン間隔を大きくして、タッチ操作をより正確にする.プレーヤーのタッチサポートを有効にする:\n- 左右にスワイプして再生の進行状況を調整します\n- 上下にスワイプして音量を調整します\n- 進行状況の調整は左上と右上でキャンセルできます\n- 異なる位置にスワイプすると、3つの異なる感度を使用できます.`],["touchVideoPlayerAnimation",`タッチ調整のヒントボックスにアニメーションの表示と非表示のどうかを決定します.このアニメーションはフレームがドロップされる可能性があります.`],["touchVideoPlayerDoubleTapControl",`操作方法を変更する.クリック:制御欄を表示/非表示, ダブルクリック放送/一時停止.`],["toast",`ウェブページの左下隅に表示スクリプトからのメッセージ、例えば更新通知の送信、エラーメッセージなどです.`],["toastInternalError",`オープンしたら、エラーメッセージは詳細な技術的エラー情報とスタック追跡を表示します.これは通常問題発生の原因を正確に確定するために使用されます.だから、問題を報告する時にこれらの情報はとても役に立ちます.`],["useCache",`スクリプトの読み込み速度を上げるためにキャッシュを使う.`],["filenameFormat",`ファイルの命名形式をカスタマイズする、<span>下载弹幕</span>、<span>下载视频</span>、<span>视频截图</span>、<span>查看封面</span>に作用する.\n使用できる変数は:\n- <span>title</span>: 動画のタイトル/配信ルームのタイトル\n- <span>ep</span>: エピソードタイトル\n- <span>aid</span>: AV番号 (動画アドレス番号)\n- <span>cid</span>: CID (動画の唯一の番号、動画アドレス番号に対応するの動画アドレスは複数の動画を含み得る)\n- <span>lid</span>: 配信ルーム番号\n- <span>y</span>/<span>M</span>/<span>d</span>: 年/月/日\n- <span>h</span>/<span>m</span>/<span>s</span>/<span>ms</span>: 時間/分/秒/ミリ秒\n\nデフォルトの命名形式は<span>[title][ - ep]</span>、動画のタイトル+エピソードタイトル、エピソードタイトルがない場合は動画のタイトルを表示する.\n\n変数は角括弧内に配置され、角括弧内のその他の内容は変数が有効な場合に表示されます. 例えば、命名形式が<span>[title] - [ep]</span>書かれている場合ではエピソードタイトルがなくても、この<span> - </span>ファイル名にも表示されます. デフォルトとして角括弧で囲まれている場合、エピソードタイトルがない、<span> - </span>が表示されません.\n\n例えば、タイトル＋AV番号＋時間の命名形式が欲しい、<span>[title][ AVaid] [y]-[M]-[d] [h]-[m]-[s]</span>に設定することができます. <span>xxxx AV23333 2019-06-1 22-22-22</span>ような名前をつけることができます.`],["sideBarOffset",`設定ボタンの垂直オフセット、単位はパーセント、許容範囲は-40％〜40％です.`],["useDefaultVideoSpeed",`デフォルトの再生速度を使用するかどうかを設定します.`],["defaultVideoSpeed",`デフォルトの動画再生速度を設定する.`],["autoDraw",`ライブルームに抽選活動がある場合は、「受け取り」ボタンを自動的にクリックします.\n    注意:少量の抽選にしか適用されますので、「99＋限定抽選」は他の人のスピードに追いつけないかもしれません.`],["ajaxHook",`「Ajax Hook API」を有効にするかどうか、他のプラグインまたは追加機能は、この「API」を通じて「Ajax」が要求する情報を取得できます.`],["scriptLoadingMode",`スクリプト機能読み込みモード:\n- 同時: Bilibiliのページと同時に読み込む\n- 延後: Bilibiliのページを優先的に読み込み、元のページの読み込みが完了したらスクリプトの読み込みを開始します\n- 同時(自動): さまざまなページに従って読み込みモードを自動的に選択します．デフォルトは「同時」モード\n- 延後(自動): さまざまなページに従って読み込みモードを自動的に選択します．デフォルトは「延後」モード`],[`fullActivityContent`,`情報内容がどれぐらい長いにも関わらず、いつも完全な内容を展開します.`],[`activityImageSaver`,`大きなフィード画像を右クリックすると、画像付きのメッセージがポップアップ表示され、簡単に保存できます.`],[`selectableColumnText`,`コラムのテキストを選択可能にする.`],[`watchlaterExpireWarnings`,`「後で見る」の動画は、追加後60日で有効期限が切れます.この機能を開くと、14日より後のリストに有効期限の警告が表示されます.`],[`miniPlayerTouchMove`,`ミニプレーヤーをタッチしてドラッグする.`],[`feedsFilter`,`タイプまたはキーワードでフィードホームページの内容をフィルタリングするか、フィードページのいくつかのサイドカードを削除します. ご注意ください：今、「すべてのフィード」でのみ有効にする、別のカテゴリに切り替える場合は無効.`],[`hideBangumiSponsors`,`番組ページの下のスポンサーランクと右側のスポンサーボタンを隠す.`],[`hideRecommendLive`,`動画ページ右側のおすすめ生放送を隠す.`],[`hideRelatedVideos`,`番組と動画ページ右側のおすすめ動画を隠す.`],[`simplifyHome`,`ホームページを置き換えます.2つのスタイルがあります:\n- さわやか: レイアウトは元のホームページに似ており、フィードセクションが追加されています.\n- ミニマル: 他のすべてのセクションを削除し、動画フィードと人気動画のみを残します.`],[`autoMatchMedal`,`今の配信ルームの勲章を持っている場合は、自動的にそれを着用します.それ以外の場合は、最後に手動で選択した勲章を着用します.`],[`urlParamsClean`,`冗長な追跡パラメーターをリンクから自動的に削除します.`],[`collapseLiveSideBar`,`生放送のサイドカードを自動的に収めます.`],[`batchFilenameFormat`,`バッチダウンロードファイルの命名形式をカスタマイズする、ルールは単一<span>文件命名格式</span>と同じです.\n新しい変数:\n- <span>n</span>: 番号、n番目の動画を意味します.`],[`removeGameMatchModule`,`電子スポーツプレート区を削除.`],[`recordLiveDanmaku`,`追加機能に生放送弾幕レコーダーを追加し、生放送弾幕を記録して「XML」をエクスポートできます.`],[`feedsTranslate`,`フィードごとの下に翻訳ボタンを追加して、フィード内容を中国語に翻訳します.「UI 翻訳」がオンになっている場合、「UI 翻訳」で設定された言語に翻訳されます.`],[`feedsTranslateProvider`,`機械翻訳の提供者`],[`updateCdn`,`ホットアップデートのアップデートソース、オフラインバージョンとスクリプト本体アップデートには無効.`],[`preserveEventBanner`,`動画ページの活動バナーを保持.`],[`useDefaultLiveQuality`,`デフォルトのライブ画質を使用するかどうかを制御します.デフォルトのライブ画質は検出され、配信ルームに入ると設定された画質に自動的に変更されます.`],[`defaultLiveQuality`,`デフォルトのライブ画質を選択します.`],[`fixedSidebars`,`フィードホームページの頂欄とサイドカードを強制的に固定します.フィードフィルターの固定解除効果よりも優先度が高く、高速プルによるジッターを回避できます.`],[`extendFeedsLive`,`フィードページの<span>配信中</span>で、生放送情報にタイトルを追加し、10個を超える生放送ルーム情報を表示できます.`],[`playerOnTop`,`動画ページのプレーヤーを上に表示すると、タイトル/ UPメッセージなどの情報が下に移動します.`],[`preferAvUrl`,`動画のリンクがBV番号の場合、自動的にAV番号に変換されます.`],[`elegantScrollbar`,`薄いスクロールバーを使用してシステムのデフォルトのスクロールバーを置き換える. (無効な夜間モード)`],[`quickFavorite`,`すばやくのお気に入りを有効にし、動画ページで、1つのキーでお気に入りを特定のお気に入りセットに追加できます.`],[`darkColorScheme`,`夜間モードでシステムが設定した「明るい/暗いテーマ」を同期させる.`],[`disableFeedsDetails`,`フィードページをクリックして詳細ページにジャンプすることは禁止されています.これはテキストを選択するのに便利です.`],[`danmakuSendBar`,`生放送ページの全画面モードとウェブの全画面モードでは、弾幕欄が下部に表示されます.`],[`watchLaterRedirectNavbar`,`頂欄の「後で見る」リンクをリダイレクトします.`],[`watchLaterRedirectPage`,`「後で見る」ページのリンクをリダイレクトします.`],[`showCoverBeforePlay`,`動画の再生が始まる前に、プレーヤーにサムネイルを表示します.`],[`customNavbarGlobalFixed`,`頂欄は、カスタム頂欄を使用するすべてのページで固定されているため、スクロールの影響を受けません.`]]);return{export:{toolTips:n}}}})();
onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.loader.min.js"] = (()=>{return(t,e)=>{function n(t){const e=t.querySelector("input");if(e){return e.getAttribute("key")}return null}const o=async()=>{e.applyStyle("settingsTooltipStyle");const{toolTips:t}=await e.importAsync(`settings-tooltip.${getI18nKey()}`);const o=await SpinQuery.select(".gui-settings-tooltip");if(!o){return}document.querySelectorAll(".gui-settings-content>ul>li").forEach(e=>{e.addEventListener("mouseover",()=>{const s=n(e);if(s===null||t===null){return}const i=t.get(s);if(i!==undefined){o.innerHTML=i;o.classList.add("show")}});e.addEventListener("mouseout",()=>{o.classList.remove("show")})})};return{export:{loadTooltip:o}}}})();
onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.min.css"] = `.gui-settings-tooltip{position:fixed;left:440px;color:#fff;background:#0008;padding:1rem;font-size:12pt;top:50%;transform:translateY(-50%);transition:.2s ease-out .8s;opacity:0;min-width:100%;max-height:100%;line-height:2;white-space:pre-wrap;pointer-events:none}.round-corner .gui-settings-tooltip{border-radius:var(--large-corner-radius)}.gui-settings-tooltip.show{pointer-events:initial;opacity:1}.gui-settings-tooltip span{font-weight:700}`;
onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.min.js"] = (()=>{return(e,a)=>{const n={useDefaultPlayerMode:`控制是否使用默认播放器模式, 可以为<span>常规</span>, <span>宽屏</span>, <span>网页全屏</span>或<span>全屏</span>.`,defaultPlayerMode:`设置默认的播放器模式.`,applyPlayerModeOnPlay:`是否在播放时应用模式, 若选择否就会在未开始播放时就应用.`,useDefaultPlayerLayout:`设置默认的播放器布局, 尽量在相应的页面里设置(比如在番剧播放页面设置番剧播放器布局), 否则可能没有效果.\n- 旧版: 传统布局\n- 新版: 视频区默认的新版布局\n注: 旧版布局中, 很多脚本功能将不适用.`,defaultPlayerLayout:`设置视频区的布局.`,defaultBangumiLayout:`设置番剧区的布局.`,useDefaultVideoQuality:`进入视频时自动选择指定的画质, 若视频最高画质低于所选画质, 则使用视频的最高画质.`,defaultVideoQuality:`设定自动选择的视频画质.`,autoLightOff:`首次播放时, 自动进入关灯模式, 并在播放结束后自动开灯.`,useDefaultDanmakuSettings:`设置默认是否开启弹幕, 以及是否记住防挡字幕和智能防挡弹幕.`,enableDanmaku:`控制弹幕是否默认开启.`,rememberDanmakuSettings:`控制是否记住弹幕设置, 包括防挡字幕和智能防挡弹幕. 在播放器中改动这些设置后, 每个视频都会默认使用这些设置.`,expandDanmakuList:`新版播放页面中, 弹幕列表默认收起以显示推荐的其他视频. 启用此功能可在每次加载视频时自动展开弹幕列表.`,expandDescription:`长的视频简介默认会被折叠, 启用此功能可以强制展开完整的视频简介.`,autoPlay:`进入视频页面时自动开始播放视频.`,autoContinue:`播放视频时如果检测到历史记录信息(<span>上次看到...</span>消息), 则自动跳转到相应的时间播放.`,skipChargeList:`自动跳过视频结尾的充电鸣谢.`,framePlayback:`在播放器的时间右边增加两个按钮, 用于<span>较</span>精细调整视频时间. 支持键盘快捷键<span>Shift + 左/右方向键</span>. (旧版播放器只能用键盘快捷键, 不会显示按钮)`,playerFocus:`进入视频/番剧页面时, 自动定位到播放器.`,playerFocusOffset:`定位时的竖直偏移量, 单位为像素(px).`,customStyleColor:`设定顶栏(样式调整启用时)和夜间模式使用的主题色, 可以点击颜色预览的圆圈打开色板, 其中含有预定义的16种主题色, 也可以在右侧的文本框直接输入任何有效的16进制颜色值(<span>#rrggbb</span>或<span>#rgb</span>).`,useNewStyle:`<span>主要</span>会改变顶栏的样式, 并有一些其他地方的界面微调:\n- 为播放器增加主题色投影\n- 可控制顶栏对横幅的透明度\n- 使播放器按钮垂直对齐\n- 使部分搜索栏的提示文字的颜色更清晰\n- 隐藏播放页面的"返回旧版"侧栏\n- 修复直播间一些文字初始状态不正确\n- 窄屏幕下强制保留弹幕发送栏`,blurBackgroundOpacity:`设置顶栏对横幅的透明度(0~1), 数值越高顶栏越淡, 当横幅关闭时此选项无效.`,useDarkStyle:`夜间模式更适合光线暗的环境, 并会大量应用主题颜色.`,darkSchedule:`设置一个使用夜间模式的时间段, 进入/离开此时间段时, 会自动开启/关闭夜间模式.\n结束时间小于起始时间时将视为次日, 如<span>18:00</span>至<span>6:00</span>表示晚上18:00到次日6:00.`,darkScheduleStart:`设置计划时段的起始时间.`,darkScheduleEnd:`设置计划时段的结束时间.`,compactLayout:`设置首页是否使用紧凑布局, 视频的间距会减小并削去圆角, 分区栏的图标会使用高清重制版. 目前仅支持首页, 其他分区的样式后续会添加.`,useCommentStyle:`- 删除热评头像下方的关注按钮\n- 删除用户的等级标识\n- 删除发送源信息(<span>来自安卓客户端</span>这种)\n- 发送时间移动到右上角\n- 位图图标全部换用矢量图标, 高分屏不会模糊\n注: 关注和等级可以通过鼠标停留在头像上, 在弹出的资料卡小窗中查看.`,simplifyLiveroom:`- 隐藏姥爷图标\n- 隐藏粉丝勋章\n- 隐藏活动头衔\n- 隐藏用户等级\n- 隐藏舰长图标\n- 隐藏全区广播\n- 隐藏欢迎信息 (xxx姥爷进入直播间)\n- 隐藏抽奖提示 (开通舰长, 小飞船抽奖等)\n- 禁用直播间皮肤\n每一项都可以在<span>附加功能</span>中单独选择是否隐藏.`,overrideNavBar:`开启后, 在主站中总是把搜索框置于顶栏, 如果页面里没有搜索栏则不会显示.`,showBanner:`控制是否显示主站顶部的横幅`,preserveRank:`控制是否在搜索框左侧显示排行榜图标.`,blurVideoControl:`模糊视频控制栏背景, 原版的阴影效果将无效.`,customControlBackground:`给视频控制栏附上半透明的黑色, 代替原来的阴影.`,customControlBackgroundOpacity:`设置控制栏着色的黑色不透明度(0~1), 数值越大黑色越浓.`,harunaScale:`根据屏幕DPI缩放直播看板娘的大小以提高像素的清晰度.`,removeLiveWatermark:`删除观看直播时角落的水印.`,removeVideoTopMask:`删除视频里鼠标经过时出现在右上角的覆盖层.`,removeAds:`删除站内的各种广告. 包括首页的推广模块, 手机app推荐, 视频页面右侧的广告等.`,watchLaterRedirect:`将稍后再看的链接重定向为普通播放网址, 以使用新版播放页面.`,favoritesRedirect:`将个人空间收藏夹里的视频重定向为直链, 而不是收藏夹播单链接.`,hideTopSearch:`将搜索框的推荐词替换为<span>搜索</span>.`,fullTweetsTitle:`在顶栏的动态预览框中, 总是展开完整的标题.`,fullPageTitle:`在视频选集列表中, 总是展开完整的标题.`,showDeadVideoTitle:`在个人空间中, 为已失效视频恢复标题和封面.`,useBiliplusRedirect:`将失效视频重定向到BiliPlus.`,biliplusRedirect:`在视频/番剧/空间中, 附加功能<span>"转到BiliPlus"</span>, 点击可以转到BiliPlus上对应的页面.`,imageResolution:`根据屏幕DPI请求更高分辨率的图片, 例如DPI缩放200%则请求2倍的分辨率, 加载时间也会相应变长一些.`,oldTweets:`将新版动态的链接换为旧版动态, 同时可在附加功能中在新旧动态间切换.`,touchNavBar:`删除顶栏右侧的一级链接(从<span>大会员</span>到<span>历史</span>), 以方便触屏设备快速预览信息. 被删除的链接可从各预览中的<span>查看更多</span>进入.`,comboLike:`为素质三连(长按点赞)启用触摸支持.`,touchVideoPlayer:`增大控制栏的按钮间距, 使触摸操作更准确. 并为播放器启用触摸支持:\n- 左右滑动可调整进度\n- 上下滑动可调整音量\n- 进度调整可在左上角和右上角取消\n- 在不同位置滑动, 可以使用3档不同的灵敏度.`,touchVideoPlayerAnimation:`决定是否要对触摸调整的提示框使用出现/消失动画, 此动画可能导致掉帧.`,touchVideoPlayerDoubleTapControl:`将操作方式更改为: 单击显示/隐藏控制栏, 双击播放/暂停.`,toast:`允许在网页左下角显示来自本脚本的消息, 如更新提醒, 错误提示等.`,toastInternalError:`开启后, 错误消息将显示详细的技术性错误信息及堆栈跟踪, 这通常用于准确地确定问题发生的原因, 所以报告问题时这些信息会非常有用.`,useCache:`使用缓存以提高脚本的加载速度.`};function t(e){const a=e.querySelector("input");if(a){return a.getAttribute("key")}return null}(async()=>{a.applyStyle("settingsTooltipStyle");const e=await SpinQuery.select(()=>document.querySelector(".gui-settings-tooltip"));document.querySelectorAll(".gui-settings-content>ul>li").forEach(a=>{a.addEventListener("mouseover",()=>{const s=n[t(a)];if(s!==undefined){e.innerHTML=s;e.classList.add("show")}});a.addEventListener("mouseout",()=>{e.classList.remove("show")})})})();return{export:{toolTips:n}}}})();
onlineData["https://raw.githubusercontent.com/the1812/Bilibili-Evolved/master/min/settings-tooltip.zh-CN.min.js"] = (()=>{return(a,n)=>{const e=new Map([["useDefaultPlayerMode",`控制是否使用默认播放器模式, 可以为<span>常规</span>, <span>宽屏</span>, <span>网页全屏</span>或<span>全屏</span>.`],["defaultPlayerMode",`设置默认的播放器模式.`],["applyPlayerModeOnPlay",`是否在播放时应用模式, 若选择否就会在未开始播放时就应用.`],["useDefaultPlayerLayout",`设置默认的播放器布局, 尽量在相应的页面里设置(比如在番剧播放页面设置番剧播放器布局), 否则可能没有效果.\n- 旧版: 传统布局\n- 新版: 视频区默认的新版布局\n注: 旧版布局中, 很多脚本功能将不适用.`],["defaultPlayerLayout",`设置视频区的布局.`],["defaultBangumiLayout",`设置番剧区的布局.`],["useDefaultVideoQuality",`进入视频时自动选择指定的画质, 若视频最高画质低于所选画质, 则使用视频的最高画质.`],["defaultVideoQuality",`设定自动选择的视频画质.`],["autoLightOff",`首次播放时, 自动进入关灯模式, 并在播放结束后自动开灯.`],["useDefaultDanmakuSettings",`设置默认是否开启弹幕, 以及是否记住防挡字幕和智能防挡弹幕.`],["enableDanmaku",`控制弹幕是否默认开启.`],["rememberDanmakuSettings",`控制是否记住弹幕设置, 包括防挡字幕和智能防挡弹幕. 在播放器中改动这些设置后, 每个视频都会默认使用这些设置.`],["expandDanmakuList",`新版播放页面中, 弹幕列表默认收起以显示推荐的其他视频. 启用此功能可在每次加载视频时自动展开弹幕列表.`],["expandDescription",`长的视频简介默认会被折叠, 启用此功能可以强制展开完整的视频简介.`],["autoPlay",`进入视频页面时自动开始播放视频.`],["autoContinue",`播放视频时如果检测到历史记录信息(<span>上次看到...</span>消息), 则自动跳转到相应的时间播放.`],["skipChargeList",`自动跳过视频结尾的充电鸣谢.`],["framePlayback",`在播放器的时间右边增加两个按钮, 用于<span>较</span>精细调整视频时间. 支持键盘快捷键<kbd>Shift</kbd>+<kbd>←</kbd>/<kbd>→</kbd>. (旧版播放器只能用键盘快捷键, 不会显示按钮)`],["playerFocus",`进入视频/番剧页面时, 自动定位到播放器.`],["playerFocusOffset",`定位时的竖直偏移量, 单位为像素(px).`],["customStyleColor",`设定顶栏(自定义顶栏启用时)和夜间模式使用的主题色, 可以点击颜色预览的圆圈打开色板, 其中含有预定义的16种主题色, 也可以在右侧的文本框直接输入任何有效的16进制颜色值(<span>#rrggbb</span>或<span>#rgb</span>).`],["useNewStyle",`<span>主要</span>会改变顶栏的样式, 并有一些其他地方的界面微调:\n- 为播放器增加主题色投影\n- 可控制顶栏对横幅的透明度\n- 使播放器按钮垂直对齐\n- 使部分搜索栏的提示文字的颜色更清晰\n- 隐藏播放页面的"返回旧版"侧栏\n- 修复直播间一些文字初始状态不正确\n- 窄屏幕下强制保留弹幕发送栏`],["blurBackgroundOpacity",`设置顶栏对横幅的透明度(0~1), 数值越高顶栏越淡, 当横幅关闭时此选项无效.`],["useDarkStyle",`夜间模式更适合光线暗的环境, 并会大量应用主题颜色.`],["darkSchedule",`设置一个使用夜间模式的时间段, 进入/离开此时间段时, 会自动开启/关闭夜间模式.\n结束时间小于起始时间时将视为次日, 如<span>18:00</span>至<span>6:00</span>表示晚上18:00到次日6:00.`],["darkScheduleStart",`设置计划时段的起始时间.`],["darkScheduleEnd",`设置计划时段的结束时间.`],["compactLayout",`设置首页是否使用紧凑布局, 视频的间距会减小, 分区栏的图标会使用高清重制版.`],["useCommentStyle",`- 删除热评头像下方的关注按钮\n- 删除用户的等级标识\n- 删除发送源信息(<span>来自安卓客户端</span>这种)\n- 删除用户名右边的勋章\n- 删除评论区顶部的横幅\n- 发送时间移动到右上角\n- 位图图标全部换用矢量图标, 高分屏不会模糊\n- 投票仅显示链接, 隐藏下面的大框.\n注: 关注和等级可以通过鼠标停留在头像上, 在弹出的资料卡小窗中查看.`],["simplifyLiveroom",`- 隐藏老爷图标\n- 隐藏粉丝勋章\n- 隐藏活动头衔\n- 隐藏用户等级\n- 隐藏舰长图标\n- 隐藏全区广播\n- 隐藏欢迎信息 (xxx老爷进入直播间)\n- 隐藏礼物弹幕 (仅弹幕列表, 特殊效果如节奏风暴不受影响)\n- 隐藏上舰提示 (弹幕列表里的 xxx开通了舰长)\n- 隐藏付费礼物 (播放器下面的各种金瓜子礼物, 以及许愿瓶, 上舰等)\n- 隐藏入场特效\n- 隐藏看板娘\n- 隐藏活动横幅\n- 隐藏抽奖提示 (开通舰长, 小飞船抽奖等)\n- 禁用直播间皮肤\n每一项都可以在<span>附加功能</span>中单独选择是否隐藏.`],["preserveRank",`控制是否在搜索框左侧显示排行榜图标.`],["blurVideoControl",`模糊视频控制栏背景, 原版的阴影效果将无效.`],["customControlBackground",`给视频控制栏附上半透明的黑色, 代替原来的阴影.`],["customControlBackgroundOpacity",`设置控制栏着色的黑色不透明度(0~1), 数值越大黑色越浓.`],["harunaScale",`根据屏幕DPI缩放直播看板娘的大小以提高像素的清晰度.`],["removeLiveWatermark",`删除观看直播时角落的水印.`],["removeVideoTopMask",`删除视频里鼠标经过时出现在右上角的覆盖层.`],["removeAds",`删除站内的各种广告. 包括首页的推广模块, 手机app推荐, 视频页面右侧的广告等.`],["showBlockedAdsTip",`删除首页推广模块的广告后显示"🚫已屏蔽广告"来替代空白区域.`],["watchLaterRedirect",`将稍后再看的链接重定向为普通播放网址, 以使用新版播放页面. 可以分别选择是否重定向顶栏和稍后再看页面.`],["favoritesRedirect",`将个人空间收藏夹里的视频重定向为直链, 而不是收藏夹播单链接.`],["hideTopSearch",`将搜索框的推荐词替换为<span>搜索</span>.`],["fullTweetsTitle",`在顶栏的动态预览框中, 总是展开完整的视频标题.`],["fullPageTitle",`在视频选集列表中, (选集多时)展开整个列表, 当标题超出一行时, 另起一行以显示完整标题.`],["showDeadVideoTitle",`在个人空间中, 为已失效视频恢复标题和封面.`],["useBiliplusRedirect",`将失效视频重定向到BiliPlus.`],["deadVideoTitleProvider",`失效视频的信息来源: 稍后再看较稳定, 但需要一点时间来查询; BiliPlus速度更快, 但是因为没写完暂不开放.`],["biliplusRedirect",`在视频/番剧/空间中, 附加功能<span>"转到BiliPlus"</span>, 点击可以转到BiliPlus上对应的页面.`],["imageResolution",`根据屏幕DPI请求更高分辨率的图片, 例如DPI缩放200%则请求2倍的分辨率, 加载时间也会相应变长一些.`],["oldTweets",`将新版动态的链接换为旧版动态, 同时可在附加功能中在新旧动态间切换.`],["touchNavBar",`删除顶栏右侧的一级链接(从<span>大会员</span>到<span>历史</span>), 以方便触屏设备快速预览信息. 被删除的链接可从各预览中的<span>查看更多</span>进入.`],["comboLike",`为素质三连(长按点赞)启用触摸支持.`],["touchVideoPlayer",`增大控制栏的按钮间距, 使触摸操作更准确. 并为播放器启用触摸支持:\n- 左右滑动可调整进度\n- 上下滑动可调整音量\n- 进度调整可在左上角和右上角取消\n- 在不同位置滑动, 可以使用3档不同的灵敏度.`],["touchVideoPlayerAnimation",`决定是否要对触摸调整的提示框使用出现/消失动画, 此动画可能导致掉帧.`],["touchVideoPlayerDoubleTapControl",`将操作方式更改为: 单击显示/隐藏控制栏, 双击播放/暂停.`],["toast",`允许在网页左下角显示来自本脚本的消息, 如更新提醒, 错误提示等.`],["toastInternalError",`开启后, 错误消息将显示详细的技术性错误信息及堆栈跟踪, 这通常用于准确地确定问题发生的原因, 所以报告问题时这些信息会非常有用.`],["useCache",`使用缓存以提高脚本的加载速度.`],["outerWatchlater",`将视频页面菜单里的<span>稍后再看</span>移到外面.`],["i18n",`为界面中一些常用文本提供翻译.`],["i18nLanguage",`翻译的目标语言.`],["customNavbar",`启用自定义顶栏, 替代原版的顶栏, 仅对主站生效, 不影响直播/相簿/会员购等.`],["customNavbarSeasonLogo",`是否使用季节Logo代替普通的Logo.`],["customNavbarFill",`是否使用主题色填充顶栏.`],[`customNavbarTransparent`,`在有横幅的时候使顶栏透明.`],["customNavbarShadow",`是否为顶栏添加一层阴影效果.`],["customNavbarCompact",`是否为顶栏使用更紧凑的布局, 紧凑布局将使用更小的间距, 以及在视频标题过长时用...省略后面的部分.`],["customNavbarBlur",`是否在顶部横幅存在时, 使用背景模糊效果.`],["playerShadow",`为播放器添加主题色投影.`],["narrowDanmaku",`在网页全屏时, 即使宽度过小也强制保留弹幕发送栏, 注意这可能导致右侧的功能按钮挤出边界.`],["hideOldEntry",`隐藏播放页右侧的<span>返回旧版</span>入口.`],["hideBanner",`隐藏首页顶部横幅.`],["allowJumpContinue",`当历史记录的集数与当前打开的不一致时, 仍然自动跳转.`],["hideBangumiReviews",`隐藏番剧播放页面里的点评板块.`],["videoScreenshot",`启用视频快速截图, 将在播放器的时间右边增加一个截图按钮. 支持键盘快捷键<kbd>Ctrl</kbd>+<kbd>Alt</kbd>+<kbd>C</kbd>. (旧版播放器只能用键盘快捷键, 不会显示按钮)\n如果弹幕渲染类型选择了Canvas, 则可以再按住<kbd>Shift</kbd>键来截取带弹幕的截图. 也就是鼠标操作为"按住<kbd>Shift</kbd>点击截图按钮", 键盘操作为"<kbd>Ctrl</kbd>+<kbd>Shift</kbd>+<kbd>Alt</kbd>+<kbd>C</kbd>".`],["filenameFormat",`自定义文件命名格式, 作用于<span>下载弹幕</span>, <span>下载视频</span>, <span>视频截图</span>, <span>查看封面</span>.\n可以使用的变量有:\n- <span>title</span>: 视频标题/直播间标题\n- <span>ep</span>: 选集标题\n- <span>aid</span>: AV号\n- <span>cid</span>: CID (每个视频的唯一编号, AV号对应的视频可能有多集)\n- <span>lid</span>: 直播间号\n- <span>y</span>/<span>M</span>/<span>d</span>: 年/月/日\n- <span>h</span>/<span>m</span>/<span>s</span>/<span>ms</span>: 时/分/秒/毫秒\n\n默认的格式是<span>[title][ - ep]</span>, 标题+选集标题, 当没有选集标题时则只有标题.\n\n变量要放在方括号里, 而方括号里的其他内容会在变量有效时出现. 比如格式如果写成<span>[title] - [ep]</span>, 那么即使没有选集标题, 中间那个<span> - </span>也会出现在文件名里. 如果像默认那样放在方括号里, 没有选集标题时, <span> - </span>也不会出现.\n\n例如, 想要标题+AV号+时间的格式, 可以设定为<span>[title][ AVaid] [y]-[M]-[d] [h]-[m]-[s]</span>, 能够得到类似<span>xxxx AV23333 2019-05-29 19-59-44</span>的名字.`],["noLiveAutoplay",`禁止直播首页的推荐直播间自动开始播放.`],["hideHomeLive",`隐藏直播首页的推荐直播间板块.`],["sideBarOffset",`设定侧栏的垂直偏移量, 单位为百分比, 允许的范围为 -40% ~ 40%.`],["hideCategory",`隐藏主站的分区栏, 分区仍然可以从顶栏的主站菜单中进入.`],["foldComment",`动态里查看评论区时, 在底部添加一个<span>收起评论</span>按钮, 这样就不用再回到上面收起了.`],["useDefaultVideoSpeed",`设置是否使用默认视频播放速度.`],["defaultVideoSpeed",`设置默认的视频播放速度.`],["seedsToCoins",`在附加功能中添加<span>瓜子换硬币</span>的按钮, 点击可以将700银瓜子换成1个硬币, 每天限1次.`],["autoDraw",`在当前直播间有抽奖活动时, 自动点击抽奖按钮. 注意只适用于少量抽奖, 那种99+限量抽奖可能跟不上其他人的手速(`],["keymap",`为视频播放器启用更多的快捷键:\n- <kbd>w</kbd> 网页全屏\n- <kbd>t</kbd> 宽屏\n- <kbd>m</kbd> 静音\n- <kbd>d</kbd> 弹幕开关\n- <kbd>l</kbd> 点赞\n- <kbd>c</kbd> 投币\n- <kbd>s</kbd> 收藏\n- <kbd>j</kbd> 前进85秒\n- <kbd>Shift + j</kbd> 倒退85秒\n- <kbd>Shift + w</kbd> 稍后再看\n- <kbd>Shift + s</kbd> 快速收藏\n- <kbd>Shift + ↑/↓</kbd> / <kbd>Shift + ,/.</kbd> 播放速度调整\n- <kbd>Shift + /</kbd> 重置播放速度`],["doubleClickFullscreen",`允许双击播放器切换全屏, 请注意不能与<span>播放器触摸支持-启用双击控制</span>一同使用.`],["ajaxHook",`是否启用 Ajax Hook API, 其他插件或附加功能能够通过此 API 获取 Ajax 请求的信息.`],["scriptLoadingMode",`脚本功能的加载模式:\n- 同时: 与b站页面同时加载\n- 延后: 优先加载b站页面, 在b站页面加载完成后再开始加载脚本功能\n- 同时(自动): 根据页面自动选择加载模式, 默认采用同时模式\n- 延后(自动): 根据页面自动选择加载模式, 默认采用延后模式`],[`fullActivityContent`,`不管内容多长, 总是完全展开动态的内容.`],[`activityImageSaver`,`右键点击动态大图时, 如果这张图的右键菜单被禁止了, 将弹出带图片的消息方便保存.`],[`selectableColumnText`,`使专栏的文字可以选择.`],[`watchlaterExpireWarnings`,`稍后再看里的视频添加后60天会过期自动删除. 开启此功能可在期限不足14天时在稍后再看列表里显示过期警告.`],[`miniPlayerTouchMove`,`使迷你播放器的拖动条可以触摸拖动.`],[`feedsFilter`,`按照类型或者关键词过滤动态首页的内容, 也可以移除动态页的一些侧边卡片. 注意目前仅仅在全部动态里生效, 切换到别的类别时无效.`],[`hideBangumiSponsors`,`隐藏番剧页面下方的承包榜, 以及右边的承包按钮.`],[`hideRecommendLive`,`隐藏视频页面右侧下方的推荐直播.`],[`hideRelatedVideos`,`隐藏番剧和视频页面右侧的推荐视频列表.`],[`simplifyHome`,`替换原本的首页, 有两种样式可用:\n- 清爽: 布局与原主页类似, 多一个动态栏目.\n- 极简: 去除其他所有栏目, 只保留视频动态和热门视频两个功能.`],[`autoMatchMedal`,`如果拥有当前直播间的勋章, 则自动佩戴, 否则佩戴上次手动选择的勋章.`],[`urlParamsClean`,`自动删除链接中的多余跟踪参数.`],[`collapseLiveSideBar`,`自动收起直播间的侧边栏.`],[`batchFilenameFormat`,`自定义批量下载的文件命名格式, 规则同单个的<span>文件命名格式</span>.\n新增的变量:\n- <span>n</span>: 数字, 表示第n个视频.`],[`removeGameMatchModule`,`删除电竞赛事板块.`],[`recordLiveDanmaku`,`在附加功能中添加直播弹幕记录器, 可以记录直播弹幕并导出XML.`],[`feedsTranslate`,`在每条动态下方添加翻译按钮, 可将动态的文字机器翻译为中文. 若开启了界面翻译, 则会翻译成界面翻译里设定的语言.`],[`feedsTranslateProvider`,`机器翻译的提供者.`],[`updateCdn`,`热更新的更新源, 对离线版和脚本本体更新无效.`],[`preserveEventBanner`,`保留视频页面的活动横幅.`],[`useDefaultLiveQuality`,`控制是否使用默认直播画质, 将会在进入直播后检测并自动更换到设定的画质.`],[`defaultLiveQuality`,`选择默认的直播画质.`],[`fixedSidebars`,`强制固定动态主页的顶栏和侧栏, 优先级高于动态过滤器的取消固定效果, 可以避免快速下拉产生的抖动.`],[`extendFeedsLive`,`在动态的<span>正在直播</span>中, 为每一个直播间加上标题, 并且能够显示超过10个的直播间.`],[`playerOnTop`,`使视频页面播放器出现在最上方, 标题/UP主等信息往下移.`],[`preferAvUrl`,`当视频的链接是BV号时, 自动转换为AV号.`],[`elegantScrollbar`,`使用细的滚动条替代系统默认的滚动条. (对夜间模式无效)`],[`quickFavorite`,`启用快速收藏, 在视频页面可以一键收藏到设定的某个收藏夹.`],[`darkColorScheme`,`使夜间模式同步系统设置的亮/暗主题.`],[`disableFeedsDetails`,`禁止动态点击后跳转详情页, 方便选择其中的文字.`],[`danmakuSendBar`,`在直播的网页全屏和全屏模式状态下, 在底部显示弹幕栏.`],[`watchLaterRedirectNavbar`,`重定向顶栏稍后再看中的链接.`],[`watchLaterRedirectPage`,`重定向稍后再看页面中的链接.`],[`showCoverBeforePlay`,`在视频开始播放前, 在播放器中显示封面.`],[`customNavbarGlobalFixed`,`对于所有用到自定义顶栏的页面都固定顶栏, 使其不受滚动影响.`]]);return{export:{toolTips:e}}}})();
